<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>2025 Professional Baseball Stats Dashboard</title>
    <script src="https://unpkg.com/react@18/umd/react.production.min.js"></script>
    <script src="https://unpkg.com/react-dom@18/umd/react-dom.production.min.js"></script>
    <script src="https://unpkg.com/@babel/standalone/babel.min.js"></script>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap" rel="stylesheet">
    <style>
        * { box-sizing: border-box; margin: 0; padding: 0; }
        body { font-family: 'Inter', -apple-system, BlinkMacSystemFont, sans-serif; background: linear-gradient(135deg, #0f172a 0%, #1e293b 100%); min-height: 100vh; color: #e2e8f0; }
        .container { max-width: 1600px; margin: 0 auto; padding: 24px; }
        .header { text-align: center; margin-bottom: 32px; }
        .header h1 { font-size: 2.5rem; font-weight: 700; background: linear-gradient(135deg, #60a5fa, #a78bfa); -webkit-background-clip: text; -webkit-text-fill-color: transparent; margin-bottom: 8px; }
        .header p { color: #94a3b8; font-size: 1.1rem; }
        .stats-grid { display: grid; grid-template-columns: repeat(auto-fit, minmax(200px, 1fr)); gap: 16px; margin-bottom: 24px; }
        .stat-card { background: rgba(30, 41, 59, 0.8); border: 1px solid rgba(148, 163, 184, 0.1); border-radius: 12px; padding: 20px; backdrop-filter: blur(10px); }
        .stat-card .label { font-size: 0.875rem; color: #94a3b8; text-transform: uppercase; letter-spacing: 0.05em; margin-bottom: 4px; }
        .stat-card .value { font-size: 2rem; font-weight: 700; color: #f1f5f9; }
        .stat-card.primary .value { color: #60a5fa; }
        .filters-panel { background: rgba(30, 41, 59, 0.8); border: 1px solid rgba(148, 163, 184, 0.1); border-radius: 12px; padding: 24px; margin-bottom: 24px; backdrop-filter: blur(10px); }
        .filters-panel h3 { font-size: 1rem; font-weight: 600; margin-bottom: 16px; color: #f1f5f9; }
        .filters-grid { display: grid; grid-template-columns: repeat(auto-fit, minmax(200px, 1fr)); gap: 16px; }
        .filter-group label { display: block; font-size: 0.875rem; font-weight: 500; color: #94a3b8; margin-bottom: 6px; }
        .filter-group input, .filter-group select { width: 100%; padding: 10px 14px; border: 1px solid rgba(148, 163, 184, 0.2); border-radius: 8px; background: rgba(15, 23, 42, 0.6); color: #f1f5f9; font-size: 0.95rem; transition: border-color 0.2s, box-shadow 0.2s; }
        .filter-group input:focus, .filter-group select:focus { outline: none; border-color: #60a5fa; box-shadow: 0 0 0 3px rgba(96, 165, 250, 0.2); }
        .filter-group input::placeholder { color: #64748b; }
        .clear-btn { padding: 10px 20px; background: rgba(239, 68, 68, 0.2); border: 1px solid rgba(239, 68, 68, 0.3); border-radius: 8px; color: #fca5a5; font-size: 0.875rem; font-weight: 500; cursor: pointer; transition: all 0.2s; align-self: end; }
        .clear-btn:hover { background: rgba(239, 68, 68, 0.3); }
        .table-container { background: rgba(30, 41, 59, 0.8); border: 1px solid rgba(148, 163, 184, 0.1); border-radius: 12px; overflow: hidden; backdrop-filter: blur(10px); }
        .table-wrapper { overflow-x: auto; max-height: 600px; overflow-y: auto; }
        table { width: 100%; border-collapse: collapse; font-size: 0.875rem; }
        thead { position: sticky; top: 0; z-index: 10; }
        th { background: rgba(15, 23, 42, 0.95); padding: 14px 12px; text-align: left; font-weight: 600; color: #e2e8f0; border-bottom: 1px solid rgba(148, 163, 184, 0.1); white-space: nowrap; cursor: pointer; user-select: none; transition: background 0.2s; }
        th:hover { background: rgba(15, 23, 42, 1); }
        th .sort-indicator { margin-left: 4px; opacity: 0.5; }
        th .sort-indicator.active { opacity: 1; color: #60a5fa; }
        td { padding: 12px; border-bottom: 1px solid rgba(148, 163, 184, 0.05); color: #cbd5e1; }
        tr:hover td { background: rgba(96, 165, 250, 0.05); }
        .name-cell { font-weight: 500; color: #f1f5f9; }
        .level-badge { display: inline-block; padding: 4px 10px; border-radius: 9999px; font-size: 0.75rem; font-weight: 600; text-transform: uppercase; }
        .level-mlb { background: rgba(234, 179, 8, 0.2); color: #fcd34d; }
        .level-aaa { background: rgba(34, 197, 94, 0.2); color: #86efac; }
        .level-aax { background: rgba(59, 130, 246, 0.2); color: #93c5fd; }
        .level-afa { background: rgba(168, 85, 247, 0.2); color: #d8b4fe; }
        .level-afx { background: rgba(236, 72, 153, 0.2); color: #f9a8d4; }
        .bats-badge { display: inline-flex; align-items: center; justify-content: center; width: 28px; height: 28px; border-radius: 6px; font-weight: 600; font-size: 0.8rem; }
        .bats-L { background: rgba(59, 130, 246, 0.2); color: #93c5fd; }
        .bats-R { background: rgba(239, 68, 68, 0.2); color: #fca5a5; }
        .pagination { display: flex; align-items: center; justify-content: space-between; padding: 16px 20px; border-top: 1px solid rgba(148, 163, 184, 0.1); flex-wrap: wrap; gap: 12px; }
        .pagination-info { color: #94a3b8; font-size: 0.875rem; }
        .pagination-controls { display: flex; align-items: center; gap: 8px; }
        .page-btn { padding: 8px 14px; background: rgba(15, 23, 42, 0.6); border: 1px solid rgba(148, 163, 184, 0.2); border-radius: 6px; color: #e2e8f0; font-size: 0.875rem; cursor: pointer; transition: all 0.2s; }
        .page-btn:hover:not(:disabled) { background: rgba(96, 165, 250, 0.2); border-color: rgba(96, 165, 250, 0.3); }
        .page-btn:disabled { opacity: 0.4; cursor: not-allowed; }
        .page-btn.active { background: #60a5fa; border-color: #60a5fa; color: #0f172a; }
        .per-page-select { padding: 8px 12px; background: rgba(15, 23, 42, 0.6); border: 1px solid rgba(148, 163, 184, 0.2); border-radius: 6px; color: #e2e8f0; font-size: 0.875rem; }
        .numeric { font-family: 'SF Mono', 'Monaco', 'Inconsolata', monospace; text-align: right; }
        .avg-row { background: linear-gradient(90deg, rgba(96, 165, 250, 0.15), rgba(167, 139, 250, 0.15)); border-top: 2px solid rgba(96, 165, 250, 0.4); }
        .avg-row td { font-weight: 600; color: #f1f5f9; padding: 14px 12px; }
        .avg-label { background: linear-gradient(135deg, #60a5fa, #a78bfa); -webkit-background-clip: text; -webkit-text-fill-color: transparent; font-weight: 700; font-size: 0.9rem; }
        tfoot { position: sticky; bottom: 0; z-index: 10; }
        @media (max-width: 768px) { .container { padding: 16px; } .header h1 { font-size: 1.75rem; } .filters-grid { grid-template-columns: 1fr; } }
    </style>
</head>

    <script type="text/babel">
        const { useState, useMemo } = React;
        function App() {
            const [nameFilter, setNameFilter] = useState('');
            const [batsFilter, setBatsFilter] = useState('');
            const [levelFilter, setLevelFilter] = useState('');
            const [sortConfig, setSortConfig] = useState({ key: null, direction: 'asc' });
            const [currentPage, setCurrentPage] = useState(1);
            const [perPage, setPerPage] = useState(50);
            const columns = [
                { key: 'Name', label: 'Name', type: 'name' },
                { key: 'Level', label: 'Level', type: 'level' },
                { key: 'Bats', label: 'Bats', type: 'bats' },
                { key: 'TBF', label: 'TBF', type: 'number' },
                { key: 'so_01', label: 'SO 0-1', type: 'number' },
                { key: 'so_10', label: 'SO 1-0', type: 'number' },
                { key: 'sor', label: 'SOR', type: 'number' },
                { key: 'inZ_1P', label: 'InZ 1P', type: 'decimal' },
                { key: 'bb_01', label: 'BB 0-1', type: 'number' },
                { key: 'bb_10', label: 'BB 1-0', type: 'number' },
                { key: 'inZ_32', label: 'InZ 3-2', type: 'decimal' },
                { key: 'prob_BB_32', label: 'Prob BB 3-2', type: 'string' },
                { key: 'bbr', label: 'BBR', type: 'number' },
                { key: 'slg_01', label: 'SLG 0-1', type: 'decimal' },
                { key: 'slg_10', label: 'SLG 1-0', type: 'decimal' },
                { key: 'slg', label: 'SLG', type: 'decimal' },
                { key: 'R2K', label: 'R2K', type: 'number' },
                { key: 'kill_rate', label: 'Kill Rate', type: 'number' },
                { key: 'whiff', label: 'Whiff', type: 'number' },
                { key: 'whiff_2K', label: 'Whiff 2K', type: 'number' },
                { key: 'chase_pre2K', label: 'Chase Pre2K', type: 'number' },
                { key: 'chase_2k', label: 'Chase 2K', type: 'number' },
                { key: 'proj_2k', label: 'Proj 2K', type: 'decimal' },
                { key: 'early_win', label: 'Early Win', type: 'decimal' }
            ];
            const levels = ["aaa", "aax", "afa", "afx", "mlb"];
            const batsOptions = ["L", "R"];
            const filteredData = useMemo(() => {
                let result = BASEBALL_DATA.filter(row => {
                    const nameMatch = !nameFilter || (row.Name && row.Name.toLowerCase().includes(nameFilter.toLowerCase()));
                    const batsMatch = !batsFilter || row.Bats === batsFilter;
                    const levelMatch = !levelFilter || row.Level === levelFilter;
                    return nameMatch && batsMatch && levelMatch;
                });
                if (sortConfig.key) {
                    result.sort((a, b) => {
                        let aVal = a[sortConfig.key];
                        let bVal = b[sortConfig.key];
                        if (aVal === 'NULL' || aVal === null || aVal === undefined) aVal = '';
                        if (bVal === 'NULL' || bVal === null || bVal === undefined) bVal = '';
                        if (typeof aVal === 'number' && typeof bVal === 'number') {
                            return sortConfig.direction === 'asc' ? aVal - bVal : bVal - aVal;
                        }
                        const strA = String(aVal).toLowerCase();
                        const strB = String(bVal).toLowerCase();
                        return sortConfig.direction === 'asc' ? strA.localeCompare(strB) : strB.localeCompare(strA);
                    });
                }
                return result;
            }, [nameFilter, batsFilter, levelFilter, sortConfig]);
            
            // Calculate averages for numeric columns
            const averages = useMemo(() => {
                const avgs = {};
                columns.forEach(col => {
                    if (col.type === 'number' || col.type === 'decimal') {
                        const values = filteredData
                            .map(row => row[col.key])
                            .filter(v => typeof v === 'number' && !isNaN(v));
                        if (values.length > 0) {
                            avgs[col.key] = values.reduce((sum, v) => sum + v, 0) / values.length;
                        } else {
                            avgs[col.key] = null;
                        }
                    }
                });
                return avgs;
            }, [filteredData]);
            
            const totalPages = Math.ceil(filteredData.length / perPage);
            const startIndex = (currentPage - 1) * perPage;
            const paginatedData = filteredData.slice(startIndex, startIndex + perPage);
            const handleSort = (key) => { setSortConfig(prev => ({ key, direction: prev.key === key && prev.direction === 'asc' ? 'desc' : 'asc' })); };
            const clearFilters = () => { setNameFilter(''); setBatsFilter(''); setLevelFilter(''); setCurrentPage(1); };
            const formatValue = (value, type) => {
                if (value === 'NULL' || value === null || value === undefined) return '';
                if (type === 'decimal' && typeof value === 'number') return value.toFixed(2);
                return value;
            };
            const formatAvg = (value, type) => {
                if (value === null || value === undefined) return '';
                if (type === 'decimal') return value.toFixed(2);
                if (type === 'number') return value.toFixed(1);
                return value;
            };
            const getLevelClass = (level) => `level-${level}`;
            const getBatsClass = (bats) => `bats-${bats}`;
            const levelCounts = useMemo(() => {
                const counts = {};
                filteredData.forEach(row => { counts[row.Level] = (counts[row.Level] || 0) + 1; });
                return counts;
            }, [filteredData]);
            return (
                <div className="container">
                    <header className="header">
                        <h1>2025 Baseball KPI Dashboard</h1>
                        <p>Professional baseball statistics and performance metrics</p>
                    </header>
                    <div className="stats-grid">
                        <div className="stat-card primary"><div className="label">Total Players</div><div className="value">{filteredData.length.toLocaleString()}</div></div>
                        <div className="stat-card"><div className="label">MLB</div><div className="value">{(levelCounts['mlb'] || 0).toLocaleString()}</div></div>
                        <div className="stat-card"><div className="label">AAA</div><div className="value">{(levelCounts['aaa'] || 0).toLocaleString()}</div></div>
                        <div className="stat-card"><div className="label">AA</div><div className="value">{(levelCounts['aax'] || 0).toLocaleString()}</div></div>
                        <div className="stat-card"><div className="label">A+</div><div className="value">{(levelCounts['afa'] || 0).toLocaleString()}</div></div>
                    </div>
                    <div className="filters-panel">
                        <h3> Filter Players</h3>
                        <div className="filters-grid">
                            <div className="filter-group">
                                <label>Player Name</label>
                                <input type="text" placeholder="Search by name..." value={nameFilter} onChange={(e) => { setNameFilter(e.target.value); setCurrentPage(1); }} />
                            </div>
                            <div className="filter-group">
                                <label>Bat Side</label>
                                <select value={batsFilter} onChange={(e) => { setBatsFilter(e.target.value); setCurrentPage(1); }}>
                                    <option value="">All</option>
                                    {batsOptions.map(opt => (<option key={opt} value={opt}>{opt === 'L' ? 'Left (L)' : 'Right (R)'}</option>))}
                                </select>
                            </div>
                            <div className="filter-group">
                                <label>Level</label>
                                <select value={levelFilter} onChange={(e) => { setLevelFilter(e.target.value); setCurrentPage(1); }}>
                                    <option value="">All Levels</option>
                                    {levels.map(level => (<option key={level} value={level}>{level.toUpperCase()}</option>))}
                                </select>
                            </div>
                            <button className="clear-btn" onClick={clearFilters}>Clear Filters</button>
                        </div>
                    </div>
                    <div className="table-container">
                        <div className="table-wrapper">
                            <table>
                                <thead>
                                    <tr>
                                        {columns.map(col => (
                                            <th key={col.key} onClick={() => handleSort(col.key)}>
                                                {col.label}
                                                <span className={`sort-indicator ${sortConfig.key === col.key ? 'active' : ''}`}>
                                                    {sortConfig.key === col.key ? (sortConfig.direction === 'asc' ? ' ' : ' ') : ' '}
                                                </span>
                                            </th>
                                        ))}
                                    </tr>
                                </thead>
                                <tbody>
                                    {paginatedData.map((row, idx) => (
                                        <tr key={startIndex + idx}>
                                            {columns.map(col => (
                                                <td key={col.key} className={col.type === 'name' ? 'name-cell' : col.type === 'number' || col.type === 'decimal' ? 'numeric' : ''}>
                                                    {col.type === 'level' ? (<span className={`level-badge ${getLevelClass(row[col.key])}`}>{row[col.key]}</span>)
                                                     : col.type === 'bats' ? (<span className={`bats-badge ${getBatsClass(row[col.key])}`}>{row[col.key]}</span>)
                                                     : formatValue(row[col.key], col.type)}
                                                </td>
                                            ))}
                                        </tr>
                                    ))}
                                </tbody>
                                <tfoot>
                                    <tr className="avg-row">
                                        {columns.map((col, idx) => (
                                            <td key={col.key} className={col.type === 'number' || col.type === 'decimal' ? 'numeric' : ''}>
                                                {idx === 0 ? (
                                                    <span className="avg-label"> AVG ({filteredData.length.toLocaleString()})</span>
                                                ) : col.type === 'number' || col.type === 'decimal' ? (
                                                    formatAvg(averages[col.key], col.type)
                                                ) : ''}
                                            </td>
                                        ))}
                                    </tr>
                                </tfoot>
                            </table>
                        </div>
                        <div className="pagination">
                            <div className="pagination-info">Showing {startIndex + 1} to {Math.min(startIndex + perPage, filteredData.length)} of {filteredData.length.toLocaleString()} players</div>
                            <div className="pagination-controls">
                                <select className="per-page-select" value={perPage} onChange={(e) => { setPerPage(Number(e.target.value)); setCurrentPage(1); }}>
                                    <option value={25}>25 per page</option>
                                    <option value={50}>50 per page</option>
                                    <option value={100}>100 per page</option>
                                    <option value={250}>250 per page</option>
                                </select>
                                <button className="page-btn" disabled={currentPage === 1} onClick={() => setCurrentPage(1)}>First</button>
                                <button className="page-btn" disabled={currentPage === 1} onClick={() => setCurrentPage(p => p - 1)}>Prev</button>
                                <span style={{ color: '#94a3b8', padding: '0 8px' }}>Page {currentPage} of {totalPages}</span>
                                <button className="page-btn" disabled={currentPage === totalPages} onClick={() => setCurrentPage(p => p + 1)}>Next</button>
                                <button className="page-btn" disabled={currentPage === totalPages} onClick={() => setCurrentPage(totalPages)}>Last</button>
                            </div>
                        </div>
                    </div>
                </div>
            );
        }
        ReactDOM.createRoot(document.getElementById('root')).render(<App />);
    </script>
</body>
</html>
